import SelectingLevelBlock from '../../components/Automation/SelectingLevelBlock';

function AutomationButtonsBlocks(props) {

    const dispatch = useDispatch();

    const namesLevelBlock = ['&#10084;', 2, 3, 4, 5, 6];

